import React from 'react';
import ProgramLeaderDashboard from './components/programLeader/ProgramLeaderDashboard';
import PrincipalDashboard from './components/principal/PrincipalDashboard';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

// Common components
import Footer from './components/common/Footer';

// Components
import Login from './components/auth/Login';
import Register from './components/auth/Register';
import Dashboard from './pages/Dashboard';
import ReportForm from './components/lecturer/ReportForm';
import MyReports from './components/lecturer/MyReports';
import StudentDashboard from './components/student/StudentDashboard';
import ReportDetail from './components/student/ReportDetail';
import RatingForm from './components/student/RatingForm';

// Authentication check function
const isAuthenticated = () => {
  const token = localStorage.getItem('token');
  const user = localStorage.getItem('user');
  return !!(token && user);
};

// Protected Route component
const ProtectedRoute = ({ children, requiredRole = null }) => {
  if (!isAuthenticated()) {
    return <Navigate to="/login" replace />;
  }

  const user = JSON.parse(localStorage.getItem('user'));

  if (requiredRole && user.role !== requiredRole) {
    return <Navigate to="/dashboard" replace />;
  }

  return children;
};

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route 
  path="/program-leader/dashboard" 
  element={
    <ProtectedRoute requiredRole="program_leader">
      <ProgramLeaderDashboard />
    </ProtectedRoute>
  } 
/>
          <Route 
  path="/principal/dashboard" 
  element={
    <ProtectedRoute requiredRole="principal_lecturer">
      <PrincipalDashboard />
    </ProtectedRoute>
  } 
/>
          {/* Public Routes */}
          <Route 
            path="/login" 
            element={!isAuthenticated() ? <Login /> : <Navigate to="/dashboard" replace />} 
          />
          <Route 
            path="/register" 
            element={!isAuthenticated() ? <Register /> : <Navigate to="/dashboard" replace />} 
          />

          {/* Protected Routes - Main Dashboard */}
          <Route 
            path="/dashboard" 
            element={
              <ProtectedRoute>
                <Dashboard />
              </ProtectedRoute>
            } 
          />

          {/* Lecturer Routes */}
          <Route 
            path="/lecturer/report-form" 
            element={
              <ProtectedRoute requiredRole="lecturer">
                <ReportForm />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/lecturer/reports" 
            element={
              <ProtectedRoute requiredRole="lecturer">
                <MyReports />
              </ProtectedRoute>
            } 
          />

          {/* Student Routes */}
          <Route 
            path="/student/dashboard" 
            element={
              <ProtectedRoute requiredRole="student">
                <StudentDashboard />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/student/report/:reportId" 
            element={
              <ProtectedRoute requiredRole="student">
                <ReportDetail />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/student/rate/:reportId" 
            element={
              <ProtectedRoute requiredRole="student">
                <RatingForm />
              </ProtectedRoute>
            } 
          />

          {/* Default Route */}
          <Route 
            path="/" 
            element={<Navigate to={isAuthenticated() ? "/dashboard" : "/login"} replace />} 
          />

          {/* 404 Route */}
          <Route 
            path="*" 
            element={<Navigate to="/dashboard" replace />} 
          />
        </Routes>
        {/* Global footer visible on every route */}
        <Footer />
      </div>
    </Router>
  );
}

export default App;
